    __webpack_exports__["default"] = "<style>.internal-header .toolbar-container{padding-top:15px !important;padding-bottom:15px !important}</style>\n<!-- Back button with a default href -->\n<ion-header  class=\"internal-header ion-align-items-center\">\n  <ion-toolbar>\n    <ion-buttons slot=\"start\">\n      <ion-back-button defaultHref=\"/home\"></ion-back-button>\n\t  \n    </ion-buttons>\n\t    <ion-title><img class=\"logo\" src=\"../assets/images/logo.svg\"></ion-title>\n\t\t  <ion-buttons slot=\"end\">\n      <ion-menu-button></ion-menu-button>\n    </ion-buttons>\n  </ion-toolbar>\n</ion-header>\n<ion-content [fullscreen]=\"true\">\n    \n\n<section  class=\"text-center internal-hero ion-align-items-center\" style='background:url(../assets/images/about-us-banner.jpg)'>\n    <h3 class=\"span-underline internal-hero-title\"><span>Disciple First Staff</span></h3>\n  </section>\n  \n\n    <ion-grid class=\"members\">\n       \n      <ion-row>  \n       <ion-col size=\"3\"><img src=\"https://disciplefirst.com/wp-content/uploads/2016/04/Craig-web-e1570565268777.jpg\"></ion-col>\n         <ion-col size=\"9\">\n             <h5 class=\"my-0\">Craig Etheredge</h5>\n             <small>FOUNDER / PRESIDENT</small>\n             <p>BIO: Craig is a gifted communicator, author, and Bible teacher. Craig and his family moved to Colleyville, Texas in July 2007 to serve as lead pastor of First Baptist Church where he currently serves. In addition to leading the local church, Craig is the Adjunct Professor of Discipleship at Southwestern Baptist Theological Seminary and is involved in the local community. He has a Master of Divinity from Southwestern Baptist Theological Seminary and a Doctor of Ministry from Trinity Evangelical Divinity School. Craig met his wife, Liz, in the fifth grade and they have two daughters, Leah Beth and Abbie.</p>\n            </ion-col>   \n        </ion-row> \n        \n        <ion-row>  \n       <ion-col size=\"3\"><img src=\"https://disciplefirst.com/wp-content/uploads/2016/04/GLENN-e1461296134167.png\"></ion-col>\n         <ion-col size=\"9\">\n             <h5 class=\"my-0\">Glenn Underhill</h5>\n             <small>SECRETARY</small>\n             <p>BIO: Originally from San Diego, Glenn attended Howard Payne University in Brownwood, TX and Southwestern Theological Seminary in Fort Worth, TX. He has served in full-time ministry for over 20 years. Glenn’s first love in ministry is disciple making – the simple, biblical model that Jesus used to make disciples who make disciples. He has trained churches, pastors and leaders through the United States and around the world in Jesus’ disciple-making model. Glenn currently serves as Executive Pastor at Crossroads Church in Newnan, GA. Glenn and his wife, Dawn, have four children.</p>\n            </ion-col>   \n        </ion-row> \n        \n        <ion-row>  \n       <ion-col size=\"3\"><img src=\"https://disciplefirst.com/wp-content/uploads/2016/04/Mark-Barfield.jpg\"></ion-col>\n         <ion-col size=\"9\">\n             <h5 class=\"my-0\">Mark Barfield</h5>\n             <small>TREASURER</small>\n             <p>BIO: Mark is a CPA, who spent the first 8 years of his career in public accounting with Price Waterhouse, and held two officer positions in a 26 year career with RadioShack Corporation, the latest as Vice President – Treasurer. Mark has been active in leading small groups at First Colleyville. Mark is a board member of Cornerstone Assistance Network, a non-profit organization assisting homeless and disadvantaged families in Tarrant County, an organization he has served for more than 20 years. Mark has an Accounting degree from Baylor University and a Master’s Degree in Accounting from the University of Texas at Austin. Mark has been married for 36 years to his wife Beverly; they have two married children, Meredith Foster and Blake Barfield, and 4 grandchildren.</p>\n            </ion-col>   \n        </ion-row> \n        \n        <ion-row>  \n       <ion-col size=\"3\"><img src=\"https://disciplefirst.com/wp-content/uploads/2017/05/chris-moody-head3.jpg\"></ion-col>\n         <ion-col size=\"9\">\n             <h5 class=\"my-0\">Chris Moody</h5>\n             <small>BOARD MEMBER</small>\n             <p>BIO: Dr. Moody wears lots of ministry hats but the one he is most proud of and the one he often says he will give up last is as a personal disciple maker. Chris currently serves as the lead pastor of Beaumont’s First Baptist Church and as an Assistant Professor of Systematic Theology for Liberty Baptist Theological Seminary in Lynchburg, VA. Dr. Moody continues to guide FBC Beaumont, an historic church founded in 1872, through a major shift in focus from a traditional SBC model of ministry to a ‘Making-DiscipleMakers’ model of ministry. Numerous onlookers throughout this ‘discipleshift’ have given the same refrain: “If First Beaumont can do it, any church can do it.”</p>\n            </ion-col>   \n        </ion-row> \n        \n        <ion-row>  \n       <ion-col size=\"3\"><img src=\"https://disciplefirst.com/wp-content/uploads/2017/05/David-Groce3.jpg\"></ion-col>\n         <ion-col size=\"9\">\n             <h5 class=\"my-0\">J. David Groce</h5>\n             <small>BOARD MEMBER</small>\n             <p>BIO: J. David Groce, the founder and senior partner, started the Groce Law Firm with the clear goal of helping small business owners maximize wealth, minimize taxes, and care for loved ones. He is also a published author.</p>\n            </ion-col>   \n        </ion-row> \n         \n          \n          \n     \n         \n          \n    \t</ion-grid>\n\n</ion-content>\n";
